import React from "react";

function TestResultsPanel({ testResults, isSubmission }) {
  if (!testResults || testResults.length === 0) {
    return null;
  }

  const passedCount = testResults.filter(test => test.passed).length;
  const totalCount = testResults.length;

  return (
    <div className="card fade-in" style={{ marginBottom: "var(--space-lg)" }}>
      <div className="card-header">
        <div className="d-flex justify-content-between align-items-center">
          <h3 style={{ margin: 0, fontSize: "1.25rem" }}>
            <i className={`fas ${isSubmission ? "fa-check-double" : "fa-vial"}`}></i> 
            {isSubmission ? "Submission Results" : "Test Results"}
          </h3>
          <div>
            <span className={`badge ${passedCount === totalCount ? "badge-success" : passedCount === 0 ? "badge-danger" : "badge-warning"}`}>
              {passedCount}/{totalCount} passed
            </span>
          </div>
        </div>
      </div>

      <div className="card-body">
        <div className="test-results-list">
          {testResults.map((test, index) => (
            <div 
              key={index} 
              className={`test-case-item ${test.passed ? "test-passed" : "test-failed"}`}
              style={{ 
                marginBottom: "var(--space-md)", 
                padding: "var(--space-md)", 
                borderRadius: "var(--radius-md)", 
                border: `1px solid ${test.passed ? "var(--success)" : "var(--danger)"}`,
                backgroundColor: test.passed ? "var(--success-light)" : "var(--danger-light)"
              }}
            >
              <div className="d-flex justify-content-between align-items-center" style={{ marginBottom: "var(--space-sm)" }}>
                <span style={{ fontWeight: 600 }}>
                  <i className={`fas ${test.passed ? "fa-check-circle" : "fa-times-circle"}`}></i> Test Case #{index + 1}
                </span>
                <span className={`badge ${test.passed ? "badge-success" : "badge-danger"}`}>
                  {test.passed ? "PASSED" : "FAILED"}
                </span>
              </div>

              <div className="d-grid" style={{ gridTemplateColumns: "repeat(3, 1fr)", gap: "var(--space-md)" }}>
                <div>
                  <div style={{ fontWeight: 600, marginBottom: "var(--space-xs)" }}>Input:</div>
                  <pre className="code-block" style={{ 
                    backgroundColor: "var(--surface-dark)", 
                    padding: "var(--space-sm)", 
                    borderRadius: "var(--radius-sm)", 
                    margin: 0,
                    overflowX: "auto",
                    fontSize: "0.9rem",
                    maxHeight: "150px"
                  }}>{test.input}</pre>
                </div>

                <div>
                  <div style={{ fontWeight: 600, marginBottom: "var(--space-xs)" }}>Expected Output:</div>
                  <pre className="code-block" style={{ 
                    backgroundColor: "var(--surface-dark)", 
                    padding: "var(--space-sm)", 
                    borderRadius: "var(--radius-sm)", 
                    margin: 0,
                    overflowX: "auto",
                    fontSize: "0.9rem",
                    maxHeight: "150px"
                  }}>{test.expected}</pre>
                </div>

                <div>
                  <div style={{ fontWeight: 600, marginBottom: "var(--space-xs)" }}>Your Output:</div>
                  <pre className="code-block" style={{ 
                    backgroundColor: "var(--surface-dark)", 
                    padding: "var(--space-sm)", 
                    borderRadius: "var(--radius-sm)", 
                    margin: 0,
                    overflowX: "auto",
                    fontSize: "0.9rem",
                    maxHeight: "150px"
                  }}>{test.actual}</pre>
                </div>
              </div>

              {test.error && (
                <div style={{ marginTop: "var(--space-md)" }}>
                  <div style={{ fontWeight: 600, color: "var(--danger)" }}>
                    <i className="fas fa-exclamation-triangle"></i> Error:
                  </div>
                  <pre style={{ 
                    backgroundColor: "var(--danger-light)", 
                    color: "var(--danger-dark)",
                    padding: "var(--space-sm)", 
                    borderRadius: "var(--radius-sm)", 
                    margin: 0,
                    overflowX: "auto",
                    fontSize: "0.9rem",
                    maxHeight: "150px"
                  }}>{test.error}</pre>
                </div>
              )}
            </div>
          ))}
        </div>
      </div>

      {isSubmission && (
        <div style={{ 
          marginTop: 16, 
          padding: 12, 
          backgroundColor: "#e9ecef", 
          borderRadius: 4, 
          fontStyle: "italic" 
        }}>
          <strong>Note:</strong> Points are awarded only for hidden test cases when submitting.
        </div>
      )}
    </div>
  );
}

export default TestResultsPanel;
